import React, {Component} from 'react';
import { NavLink } from 'react-router-dom';
import './ClinicalSkills.css';


class clinicalSkills extends Component {
	render() {
		return(
	 <React.Fragment>
	<div className= 'tc dib br3 pa3 ma2 grow bw2 shadow-5'>
	     <NavLink to = "/OxygenTherapy"> 
		  <button className= 'OT'><img src alt= 'Oxygen Therapy' src={require('./mask.jpg')}/> 
		  </button><h2 className = 'f3' > 
		{'Oxygen Therapy'}
		</h2>
		 </NavLink>
	</div>	


	<div className= 'tc dib br3 pa3 ma2 grow bw2 shadow-5'>
	     <NavLink to = "/ABG">
		  <button><img src alt= 'ABG' src={require('./ABG.jpg')}/> 
		  </button><h2 className = 'f3' > 
		{'ABG'} </h2>
		 </NavLink>

		</div>	
		 </React.Fragment>


		);
	}
}


